import './App.css';

function App() {
  return (
    <div className="App">
      <section className='panel panel-default mb-50 mt-50'>
        <section className='panel-body undefined text-left'>
          <form name='form'></form>
        </section>
      </section>
      <header className="App-header">
        <div className="form-group">
          <input type="text" id="name" className="form-control" placeholder="Product name" />
          <input type="text" id="description" className="form-control" placeholder="Product desctiption" />
          <input type="text" id="price" className="form-control" placeholder="Product price" />
          <input type="text" id="name" className="form-control" placeholder="Product name" />
        </div>
      </header>
    </div>
  );
}

export default App;
